import React from "react";
import "./gallery.css";

export default function Gallery() {
  return (
    <div>
      <div className="galleryHeader">
        <div>Today's New Post</div>
        <div> <a href=""></a> </div>
      </div>
      <div className="scrollmenu">
        <div className="galleryContainer">
          <div>
            <img className="galleryCardPhoto" src="./iphone.jpeg" alt="" />
          </div>
          <div className="galleryCardName">
            iPhone 13 Pro Max (8+256) space grey
          </div>
          <div className="galleryCardPrice">$9999.99</div>
        </div>
      </div>
    </div>
  );
}
